import React from 'react';
import './TrainSelect.css'

const TrainSelectDetail = () => {
  return (
    <div className='train-select-detail'>
      <div className='train-select-item'> {this.props.trainName} </div>
      <div className='train-select-item'> {this.props.startTime} </div>
      <div className='train-select-item'> {this.props.mileage} </div>
      <div className='train-select-item'> {this.props.firstClassSeatNum} </div>
      <div className='train-select-item'> {this.props.secondClassSeatNum} </div>
    </div>
  );
};

const TrainSelect = () => {
  let train = [
    {
      trainId: '1',
      trainName: 'G1',
      trainType: '高铁',
      startTime: '12:00',
      mileage: '1000',
      trainStop: [],
      trainSeats: [
        {seatId: '', carriage: '', seatType: '一等座', seatLocation: ''},
        {seatId: '', carriage: '', seatType: '二等座', seatLocation: ''}
        ]
    }
  ];

  return (
    <div className='train-select'>
      <TrainSelectDetail trainName={train[0].trainName} startTime={train[0].startTime} mileage={train[0].mileage}
                         firstClassSeatNum={1} secondClassSeatNum={2}/>
    </div>
  );
};

export default TrainSelect;
